CREATE DATABASE IF NOT EXISTS Motorbike_Rental_DB;

USE Motorbike_Rental_DB;

-- Table: ADDRESS
CREATE TABLE IF NOT EXISTS ADDRESS (
    AddressID  INT          NOT NULL,
    Address1   VARCHAR (30),
    Address2   VARCHAR (30),
    City       VARCHAR (30),
    State      VARCHAR (2),
    PostalCode INT,
    Country    VARCHAR (30) NOT NULL,
    PRIMARY KEY (
        AddressID
    ),
    CONSTRAINT States CHECK (state IN ('AL', 'AK', 'AZ', 'AR', 'CA', 'CO', 'CT', 'DE', 'FL', 'GA', 'HI', 'ID', 'IL', 'IN', 'IA', 'KS', 'KY', 'LA', 'ME', 'MD', 'MA', 'MI', 'MN', 'MS', 'MO', 'MT', 'NE', 'NV', 'NH', 'NJ', 'NM', 'NY', 'NC', 'ND', 'OH', 'OK', 'OR', 'PA', 'RI', 'SC', 'SD', 'TN', 'TX', 'UT', 'VT', 'VA', 'WA', 'WV', 'WI', 'WY') ),
    CONSTRAINT Code_Range CHECK (PostalCode BETWEEN 9999 AND 99999) 
);

-- Table: CUSTOMER
CREATE TABLE IF NOT EXISTS CUSTOMER (
    CustomerID    INT,
    FirstName     VARCHAR (50),
    MiddleName    VARCHAR (50),
    LastName      VARCHAR (50),
    CustomerPhone VARCHAR (50),
    CustomerEmail VARCHAR (50),
    Username      VARCHAR (50),
    Password      VARCHAR (50),
    PRIMARY KEY (
        CustomerID
    )
);
-- Table: PRODUCT
CREATE TABLE IF NOT EXISTS PRODUCT (
    ProductID           CHAR (5)       NOT NULL,
    ProductName         VARCHAR (30)   NOT NULL,
    ProductImage        CHAR,
    ProductBrand        VARCHAR (30),
    ProductColor        VARCHAR (20),
    ProductPrice        DECIMAL (6, 2) NOT NULL,
    ProductQuantity     INT,
    ProductAvailability BOOLEAN,
    ProductType         VARCHAR (10)   NOT NULL,
    PRIMARY KEY (
        ProductID
    ),
    CONSTRAINT ProductType CHECK (ProductType IN ('MOTORBIKE', 'GLOVES', 'HELMET') ) 
);

-- Table: MOTORBIKE
CREATE TABLE IF NOT EXISTS MOTORBIKE (
    ProductID     CHAR (5)     NOT NULL,
    ProductType   CHAR (30)    DEFAULT 'MOTORBIKE',
    M_HoursePower INT,
    M_TopSpeed    INT,
    Model         VARCHAR (30),
    FOREIGN KEY (
        ProductID
    )
    REFERENCES PRODUCT (ProductID) 
);

-- Table: HELMET
CREATE TABLE IF NOT EXISTS HELMET (
    ProductID    CHAR (5)     NOT NULL,
    ProductType  CHAR(30)     DEFAULT 'HELMET',
    H_Size       CHAR(2)          NOT NULL,
    H_Collection VARCHAR (20),
    H_Style      VARCHAR (20),
    FOREIGN KEY (
        ProductID
    )
    REFERENCES PRODUCT (ProductID),
    CONSTRAINT H_Style CHECK (H_Style IN ('FULL', 'HALF', 'OPEN', 'DIRTBIKE') ) 
);

-- Table: GLOVES
CREATE TABLE IF NOT EXISTS GLOVES (
    ProductID   CHAR (5) NOT NULL,
    ProductType CHAR(30) DEFAULT 'GLOVES',
    G_Size      CHAR(2)      NOT NULL,
    FOREIGN KEY (
        ProductID
    )
    REFERENCES PRODUCT (ProductID) 
);

-- Table: ADDS
CREATE TABLE IF NOT EXISTS ADDS (
    ProductID  CHAR (5) NOT NULL 
						REFERENCES PRODUCT (ProductID) ON DELETE CASCADE
                                                       ON UPDATE CASCADE,
                        
    Quantity   INTEGER  NOT NULL
                        CHECK (Quantity > 0),
    CustomerID INTEGER  NOT NULL
						REFERENCES CUSTOMER (CustomerID) ON DELETE CASCADE
                                                         ON UPDATE CASCADE,
                        
    CartID     INTEGER  NOT NULL
                        REFERENCES SHOPPING_CART (CartID) ON DELETE CASCADE
                                                          ON UPDATE CASCADE,
    PRIMARY KEY (
        ProductID,
        CustomerID,
        CartID
    )
);

-- Table: CUSTOMER_LOCATES
CREATE TABLE IF NOT EXISTS CUSTOMER_LOCATES (
    CustomerID INT,
    AddressID  INT,
    PRIMARY KEY (
        CustomerID,
        AddressID
    ),
    FOREIGN KEY (
        CustomerID
    )
    REFERENCES CUSTOMER (CustomerID),
    FOREIGN KEY (
        AddressID
    )
    REFERENCES ADDRESS (AddressID) 
);


-- Table: CREDIT_CARD
CREATE TABLE IF NOT EXISTS CREDIT_CARD (
    CardNumber      VARCHAR (50),
    ExpirationMonth INT,
    ExpirationYear  VARCHAR (50),
    CardName        VARCHAR (50),
    SecurityNumber  INT,
    CustomerID      INT,
    AddressID       INT,
    PRIMARY KEY (
        CardNumber
    ),
    FOREIGN KEY (
        CustomerID
    )
    REFERENCES CUSTOMER (CustomerID),
    FOREIGN KEY (
        AddressID
    )
    REFERENCES ADDRESS (AddressID) 
);

-- Table: ORDER
CREATE TABLE IF NOT EXISTS ORDERS (
    OrderID        INTEGER      NOT NULL
                                PRIMARY KEY,
    OrderDate      DATE         NOT NULL,
    SaleTax        DOUBLE       NOT NULL,
    ShippingOption VARCHAR (10) NOT NULL
                                CHECK (ShippingOption IN ('Standard', 'Express') ),
    ShippingDate   DATE         NOT NULL,
    ShoppingTime   INTEGER      NOT NULL,
    CartID         INTEGER      NOT NULL
								REFERENCES SHOPPING_CART (CartID) ON DELETE CASCADE
                                                                  ON UPDATE CASCADE,
                                
    CardNumber     VARCHAR(30)  NOT NULL
                                REFERENCES CREDIT_CARD (CardNumber) ON DELETE CASCADE
                                                                    ON UPDATE CASCADE
);

-- Table: SHIPPER
CREATE TABLE IF NOT EXISTS SHIPPER (
    ShipperID    INT,
    CompanyName  VARCHAR (50),
    ShipperEmail VARCHAR (50),
    ShipperPhone VARCHAR (50),
    PRIMARY KEY (
        ShipperID
    )
);

-- Table: SHIPPING
CREATE TABLE IF NOT EXISTS SHIPPING (
    ShipperID  INTEGER NOT NULL
                       REFERENCES SHIPPER (ShipperID) ON DELETE CASCADE
                                                      ON UPDATE CASCADE,
    OrderID    INTEGER NOT NULL
					   REFERENCES ORDERS (OrderID) ON DELETE CASCADE
                                                    ON UPDATE CASCADE,
                      
    CustomerID INTEGER NOT NULL
                       REFERENCES CUSTOMER (CustomerID) ON DELETE CASCADE
                                                        ON UPDATE CASCADE,
    PRIMARY KEY (
        ShipperID,
        OrderID,
        CustomerID
    )
);
-- Table: SHOPPING_CART
CREATE TABLE IF NOT EXISTS SHOPPING_CART (
    CartID    INTEGER PRIMARY KEY
                      NOT NULL,
    StartDate DATE    NOT NULL,
    StartTime TIME    NOT NULL
);

-- Table: STORES
CREATE TABLE IF NOT EXISTS STORES (
    WarehouseID INTEGER  NOT NULL 
						 REFERENCES WAREHOUSE (WarehouseID) ON DELETE CASCADE
                                                            ON UPDATE CASCADE,
                         
    ProductID   CHAR (5)  NOT NULL 
						  REFERENCES PRODUCT (ProductID) ON DELETE CASCADE
                                                         ON UPDATE CASCADE,
                        
    PRIMARY KEY (
        WarehouseID,
        ProductID
    )
);









