-- Table: SUPPLIER
CREATE TABLE IF NOT EXISTS SUPPLIER (
    SupplierID    INT          NOT NULL,
    SupplierName  VARCHAR (30) NOT NULL,
    SupplierEmail VARCHAR (30) NOT NULL,
    SupplierPhone VARCHAR (12) NOT NULL,
    PRIMARY KEY (
        SupplierID
    ),
    CONSTRAINT Email_Check CHECK (SupplierEmail LIKE '%_@__%.__%'),
    CONSTRAINT Phone_Check CHECK (length(SupplierPhone) <= 13) 
);

