-- Table: SUPPLIES
CREATE TABLE IF NOT EXISTS SUPPLIES (
    SupplierID INTEGER  NOT NULL
                        REFERENCES SUPPLIER (SupplierID) ON DELETE CASCADE
                                                         ON UPDATE CASCADE,
    ProductID  CHAR (5) NOT NULL
						REFERENCES PRODUCT (ProductID) ON DELETE CASCADE
                                                       ON UPDATE CASCADE,
    PRIMARY KEY (
        SupplierID,
        ProductID
    )
);

