-- Table: WAREHOUSE
CREATE TABLE IF NOT EXISTS WAREHOUSE (
    WarehouseID    INT          NOT NULL,
    WarehousePhone VARCHAR (12) NOT NULL,
    AddressID      INT,
    PRIMARY KEY (
        WarehouseID
    ),
    FOREIGN KEY (
        AddressID
    )
    REFERENCES ADDRESS (AddressID),
    CONSTRAINT W_Phone_Check CHECK (length(WarehousePhone) <= 13) 
);

